/*Data for the table `vtiger_reports_group` */

insert  into `vtiger_reports_group`(`id`,`report_parent_code`,`report_name`,`query_code`,`columns_total`,`is_deleted`) values (1,'IR','Opening Stock','SELECT DATE_FORMAT(inventorytransaction.date,\'%d-%m-%Y\') AS Date ,vtiger_products.barcode, vtiger_products.productname, vtiger_products.cost AS cost, inventorytransaction.opening_stock_qty AS \'Opening Stock Qty\', (inventorytransaction.opening_stock_qty * vtiger_products.cost) AS \'Total Value\' FROM (select productid , opening_stock_qty,date from vtiger_inventorytransaction order by date ASC) as inventorytransaction \r\n inner join vtiger_products on vtiger_products.productid = inventorytransaction.productid',0,1),(2,'IR','Closing Stock','SELECT DATE_FORMAT(inventorytransaction.date,\'%d-%m-%Y\') AS Date ,vtiger_products.barcode, vtiger_products.productname, vtiger_products.cost AS cost, inventorytransaction.closing_stock AS \'Closing Stock Qty\', (inventorytransaction.closing_stock * vtiger_products.cost) AS \'Total Value\' FROM (select productid , closing_stock,date from vtiger_inventorytransaction order by date DESC) as inventorytransaction \r\n inner join vtiger_products on vtiger_products.productid = inventorytransaction.productid',10,1),(3,'IR','Stock Adjustment','SELECT DATE_FORMAT(vtiger_stockadjust.debitdate,\'%d-%m-%Y\') AS \'Date\', vtiger_warehouse.warehouse_name AS \'Warehouse/Store Name\',vtiger_stockadjust.product_name AS \'Product Name\', vtiger_stockadjust.stocktotal AS \'Total Stock In Qty.\',\r\nvtiger_stockadjust.adjustqty AS \'Adjusted Quantity\', vtiger_stockadjust.adj_comments AS \'Comments\'\r\nFROM vtiger_stockadjust \r\nINNER JOIN vtiger_warehouse ON vtiger_warehouse.warehouseid = vtiger_stockadjust.warehouse_store_id\r\n',0,0),(4,'IR','Stock Report','SELECT DATE_FORMAT(vtiger_crmentity.createdtime,\"%d-%m-%Y\") AS \'Date\', vtiger_products.productname AS \'Product Name\', \r\nvtiger_warehouse.warehouse_name AS \'Warehouse/Store Name\', vtiger_warehouse_stock.qty AS \'Quantity in Stock\', \r\n(vtiger_products.cost +(vtiger_products.cost * vtiger_products.vat/100)) AS \'Cost\' ,\r\n(vtiger_warehouse_stock.qty * (vtiger_products.cost +(vtiger_products.cost * vtiger_products.vat/100))) AS \'Total Cost\'\r\nFROM vtiger_products\r\nINNER JOIN vtiger_warehouse_stock ON vtiger_warehouse_stock.productid = vtiger_products.productid\r\nINNER JOIN vtiger_warehouse ON vtiger_warehouse.warehouseid = vtiger_warehouse_stock.warehouseid\r\nINNER JOIN vtiger_crmentity ON vtiger_crmentity.crmid = vtiger_products.productid',0,0),(5,'SR','Customer Report','SELECT  vtiger_contactdetails.firstname AS \'Customer Name\', vtiger_contactdetails.email AS \'Email ID\', vtiger_contactdetails.mobile AS \'Mobile\',\r\nCONCAT(vtiger_contactaddress.mailingstreet,\' \',vtiger_contactaddress.mailingcity,\' \', vtiger_contactaddress.mailingstate,\' \', \r\nvtiger_contactaddress.mailingcountry,\' \', vtiger_contactaddress.mailingpobox,\' \') AS Address FROM vtiger_contactdetails \r\nINNER JOIN vtiger_contactaddress ON vtiger_contactaddress.contactaddressid = vtiger_contactdetails.contactid\r\nINNER JOIN vtiger_crmentity ON vtiger_contactdetails.contactid = vtiger_crmentity.crmid \r\nWHERE vtiger_crmentity.deleted=0 AND vtiger_contactdetails.contactid > 0\r\n',0,0),(6,'SR','Sales Register','SELECT DATE_FORMAT(vtiger_debtortransaction.date, \'%d-%m-%Y\') AS \'Date\' ,vtiger_debtortransaction.inv_no AS \'INV No.\', \r\nCASE WHEN (vtiger_debtortransaction.mode_of_payment != \"\" ) \r\nTHEN vtiger_debtortransaction.mode_of_payment \r\nELSE vtiger_debtortransaction.username \r\nEND AS \'Particulars\', \r\nvtiger_debtortransaction.grandtotal AS \'Gross Total\', vtiger_invoice.subtotal AS \'NetPrice\' , GROUP_CONCAT(vtiger_inventoryproductrel.quantity) AS \'quantity\', \r\nGROUP_CONCAT(vtiger_inventoryproductrel.listprice) AS \'cost\', GROUP_CONCAT(vtiger_inventoryproductrel.discount_amount) AS \'discount\', \r\nGROUP_CONCAT(vtiger_inventoryproductrel.vat) AS \'VAT\', GROUP_CONCAT(vtiger_inventoryproductrel.taxamount) AS \'Tax Amount\'\r\nFROM vtiger_debtortransaction\r\nINNER JOIN vtiger_invoice ON vtiger_invoice.invoiceid = vtiger_debtortransaction.invid\r\nINNER JOIN vtiger_inventoryproductrel ON vtiger_inventoryproductrel.id = vtiger_invoice.invoiceid',0,0),(7,'SR','Sundry Debtors','SELECT \r\nvtiger_debtortransaction.username AS \'Customer Name\',\r\nvtiger_debtortransaction.closingbalance AS \'Balance\'\r\nFROM vtiger_debtortransaction',0,0),(8,'SR','Ledger Account','SELECT * FROM vtiger_debtortransaction',0,1),(9,'SR','Cash Receipt','SELECT DATE_FORMAT(vtiger_debtortransaction.date, \'%d-%m-%Y\') AS \'Date\', vtiger_debtortransaction.inv_no AS \'Invoice Number\', \r\nvtiger_debtortransaction.grandtotal, vtiger_debtortransaction.mode_of_payment AS \'Payment Mode\', vtiger_debtortransaction.amt_received_by_cash AS \'Cash\', \r\nvtiger_debtortransaction.amt_received_by_card AS \'Card\', vtiger_debtortransaction.amt_received_by_check AS \'Check\', vtiger_debtortransaction.bank_name AS \'Bank Name\', \r\nDATE_FORMAT(vtiger_debtortransaction.check_date, \'%d-%m-%Y\') AS \'CHECK Date\', vtiger_debtortransaction.checkno AS \'CHECK Number\', vtiger_debtortransaction.modulename AS \'From\' FROM vtiger_debtortransaction \r\nWHERE vtiger_debtortransaction.mode_of_payment !=\"\"  AND modulename != \'Sales Return\'\r\n',0,0),(10,'SR','Clearence Sales','SELECT vtiger_clearance.barcode_id AS \'Barcode\', vtiger_clearance.product_name AS \'Product Name\',  vtiger_clearance.mrp AS \'Previous SellingPrice\', \r\nvtiger_clearance.discount AS \'Discount(%)\', vtiger_clearance.clearanceprice AS \'NEW SellingPrice\', vtiger_clearance.vat AS \'VAT(%)\', \r\nvtiger_clearance.newmrp AS \'NEW MRP\' FROM vtiger_clearance\r\nINNER JOIN vtiger_crmentity ON vtiger_crmentity.crmid = vtiger_clearance.productid\r\nWHERE vtiger_crmentity.deleted = 0',10,1),(11,'SR','Sales Return','SELECT TR.transaction_id, DATE_FORMAT(TR.date, \'%d-%m-%Y\') AS \'Date\', TR.invoice_no, TR.salesret_id, \r\nGROUP_CONCAT(TR.productid) AS \'productid\', \r\nGROUP_CONCAT(TR.sales_return_qty) AS \'quantity\', \r\nGROUP_CONCAT(TR.sales_return_cost) AS \'return_cost\', \r\nGROUP_CONCAT(TR.unitprice) AS \'cost\', \r\nGROUP_CONCAT(TR.discount) AS \'discount\',  \r\nGROUP_CONCAT(TR.vat) AS \'vat\'\r\nFROM vtiger_inventorytransaction AS TR',10,0),(12,'PR','Cancelled PO','SELECT DATE_FORMAT(vtiger_crmentity.createdtime,\'%d-%m-%Y\') AS \'Date\',DATE_FORMAT(vtiger_purchaseorder.duedate,\'%d-%m-%Y\') AS \'Due Date\',DATE_FORMAT(vtiger_crmentity.modifiedtime,\'%d-%m-%Y\') AS \'Cancelled Date\', vtiger_purchaseorder.purchaseorder_no AS \'PO Number\',\r\nvtiger_purchaseorder.requisition_no AS \'Ref. PO Number\', vtiger_products.productname AS \'Product Name\', vtiger_inventoryproductrel.quantity AS \'Requested Qty\',\r\nvtiger_inventoryproductrel.listprice AS \'Unit Price\',vtiger_inventoryproductrel.discount_percent AS \'Discount %\',\r\nCASE \r\n WHEN vtiger_inventoryproductrel.withcform = \'2\'\r\n  THEN vtiger_inventoryproductrel.vat\r\n WHEN vtiger_inventoryproductrel.withcform = \'1\'\r\n  THEN vtiger_inventoryproductrel.cstwithcform_per\r\n WHEN vtiger_inventoryproductrel.withcform = \'0\'    \r\n  THEN vtiger_inventoryproductrel.cstwithoutcform_per\r\n\r\nEND AS \'Tax\',\r\nvtiger_inventoryproductrel.netprice AS \'Net Price\', vtiger_vendor.vendorname AS \'Vendor Name\' FROM vtiger_purchaseorder,vtiger_products,vtiger_inventoryproductrel,vtiger_crmentity,vtiger_vendor \r\nWHERE  vtiger_purchaseorder.postatus = \"Cancelled\" AND vtiger_purchaseorder.purchaseorderid = vtiger_inventoryproductrel.id AND vtiger_crmentity.deleted = 0 \r\nAND vtiger_crmentity.crmid = vtiger_purchaseorder.purchaseorderid AND vtiger_inventoryproductrel.productid = vtiger_products.productid AND vtiger_vendor.vendorid = vtiger_purchaseorder.vendorid\r\n',10,0),(13,'PR','Vendor Report','SELECT vtiger_vendor.vendorname AS \'Vendor Name\', vtiger_vendor.phone, vtiger_vendor.email FROM vtiger_vendor,vtiger_crmentity\r\nWHERE \r\nvtiger_vendor.vendorid = vtiger_crmentity.crmid AND\r\nvtiger_crmentity.deleted = 0 ',10,1),(14,'PFR','Profit Analysis','SELECT DATE_FORMAT(vtiger_inventorytransaction.date, \'%d-%m-%Y\') AS \'Date\', vtiger_warehouse.warehouse_name AS \'Store Name\', vtiger_inventorytransaction.invoice_no AS \'Invoice Number\', \r\nvtiger_inventorytransaction.product_name AS \'Product Name\', vtiger_inventorytransaction.opening_cost AS \'Cost\',\r\nvtiger_inventorytransaction.unitprice AS \'Unit Price\', vtiger_inventorytransaction.sales_qty AS \'Quantity\' ,(vtiger_inventorytransaction.unitprice*sales_qty - vtiger_inventorytransaction.opening_cost*sales_qty) AS \"P/L (Rs.)\",\r\nFORMAT(((vtiger_inventorytransaction.unitprice*sales_qty - vtiger_inventorytransaction.opening_cost*sales_qty)/(vtiger_inventorytransaction.unitprice*sales_qty))*100,2) AS \"P/L (%)\"\r\nFROM vtiger_inventorytransaction\r\nINNER JOIN vtiger_warehouse ON vtiger_warehouse.warehouseid = vtiger_inventorytransaction.store_id\r\nWHERE vtiger_inventorytransaction.sales_qty != \"\"',0,0),(15,'IR','Stock Ledger','SELECT *  FROM vtiger_warehousestore_inventorytransaction',0,1),(16,'PR','Open PO','SELECT DATE_FORMAT(vtiger_crmentity.createdtime,\'%d-%m-%Y\') AS \'Date\',DATE_FORMAT(vtiger_purchaseorder.duedate,\'%d-%m-%Y\') AS \'Due Date\',vtiger_purchaseorder.purchaseorder_no AS \'PO Number\',\r\nvtiger_purchaseorder.requisition_no AS \'Ref. PO Number\', vtiger_products.productname AS \'Product Name\', vtiger_inventoryproductrel.quantity AS \'Requested Qty\',\r\nvtiger_inventoryproductrel.listprice AS \'Unit Price\',vtiger_inventoryproductrel.discount_percent AS \'Discount %\',\r\nCASE \r\n WHEN vtiger_inventoryproductrel.withcform = \'2\'\r\n  THEN vtiger_inventoryproductrel.vat\r\n WHEN vtiger_inventoryproductrel.withcform = \'1\'\r\n  THEN vtiger_inventoryproductrel.cstwithcform_per\r\n WHEN vtiger_inventoryproductrel.withcform = \'0\'    \r\n  THEN vtiger_inventoryproductrel.cstwithoutcform_per\r\n\r\nEND AS \'Tax\',\r\nvtiger_inventoryproductrel.netprice AS \'Net Price\', vtiger_vendor.vendorname AS \'Vendor\' FROM vtiger_purchaseorder,vtiger_products,vtiger_inventoryproductrel,vtiger_crmentity,vtiger_vendor \r\nWHERE  vtiger_purchaseorder.postatus = \"Created\" AND vtiger_purchaseorder.purchaseorderid = vtiger_inventoryproductrel.id AND vtiger_crmentity.deleted = 0 \r\nAND vtiger_crmentity.crmid = vtiger_purchaseorder.purchaseorderid AND vtiger_inventoryproductrel.productid = vtiger_products.productid AND vtiger_vendor.vendorid = vtiger_purchaseorder.vendorid',0,0),(17,'PR','Closed PO','SELECT DATE_FORMAT(vtiger_crmentity.createdtime,\'%d-%m-%Y\') AS \'Date\',DATE_FORMAT(vtiger_purchaseorder.duedate,\'%d-%m-%Y\') AS \'Due Date\',DATE_FORMAT(vtiger_crmentity.modifiedtime,\'%d-%m-%Y\') AS \'Closed PO Date\',vtiger_purchaseorder.purchaseorder_no AS \'PO Number\',\r\nvtiger_products.productname AS \'Product Name\', vtiger_inventoryproductrel.quantity AS \'Requested Qty\',\r\nvtiger_inventoryproductrel.listprice AS \'Unit Price\',vtiger_inventoryproductrel.discount_percent AS \'Discount %\',\r\nCASE \r\n WHEN vtiger_inventoryproductrel.withcform = \'2\'\r\n  THEN vtiger_inventoryproductrel.vat\r\n WHEN vtiger_inventoryproductrel.withcform = \'1\'\r\n  THEN vtiger_inventoryproductrel.cstwithcform_per\r\n WHEN vtiger_inventoryproductrel.withcform = \'0\'    \r\n  THEN vtiger_inventoryproductrel.cstwithoutcform_per\r\n\r\nEND AS \'Tax\',\r\nvtiger_inventoryproductrel.netprice AS \'Net Price\', vtiger_vendor.vendorname AS \'Vendor\' FROM vtiger_purchaseorder,vtiger_products,vtiger_inventoryproductrel,vtiger_crmentity,vtiger_vendor \r\nWHERE  vtiger_purchaseorder.postatus = \"Received Shipment\" AND vtiger_purchaseorder.purchaseorderid = vtiger_inventoryproductrel.id AND vtiger_crmentity.deleted = 0 \r\nAND vtiger_crmentity.crmid = vtiger_purchaseorder.purchaseorderid AND vtiger_inventoryproductrel.productid = vtiger_products.productid AND vtiger_vendor.vendorid = vtiger_purchaseorder.vendorid',0,0);

